import { useState } from 'react'

export default function App() {
  const [counter, setCounter] = useState(0)

  setTimeout(() => {
    setCounter(counter+2)
  }, 1000);

  return (
    <>
    <div>{counter}</div>
    <button onClick={() => setCounter(counter+1)}>
      plus
    </button>
    <button onClick={() => setCounter(0)}>
      reset
    </button>
    </>
  )
}
